import React from 'react'
import AddBook from './components/AddBook'
import Book from './components/Book'

const Home = () => {
  return (
    <div>
    <AddBook handleSubmit={handleSubmit}> </AddBook>
    {
        books &&
            books.map(
                (element) => {
                    return <Book
                        key={element.id}
                        id={element.id}
                        title={element.title}
                        author={element.author}
                        price={element.price}
                        handleRemove={handleRemove}
                        books={books}
                        setBooks={setBooks}
                    >
                    </Book>
                }
            )
    }
</div>
  )
}

export default Home
